import React from "react";
import "./BidCard.css";

function BidCard() {
  return (
    <div className="bidCard">
      <div className="left">
        <div className="img"></div>
        <div>
          <div className="title">Nike Blazer</div>
          <div className="desc">Lebron James</div>
        </div>
      </div>

      <div className="right">
        <div className="price">$150,000</div>
        <div className="currentBid">Current bid</div>
        <div className="bidButton">Place Bid</div>
      </div>
    </div>
  );
}

export default BidCard;
